import React, { Component } from "react";
import Titles from "./components/Titles";
import Form from "./components/Form";
import Display from "./components/Display";

class App extends Component {
  render() {
    return (
      <div>
        <Titles />
        <Form />
        <Display />
      </div>
    );
  }
}

export default App;
